import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <header class="hero is-success is-fullheight">
          <div class="hero-body">
            <div class="container">
              <h1 class="title">
                Fullheight title
      </h1>
              <h2 class="subtitle">
                Fullheight subtitle
      </h2>
            </div>
          </div>
        </header>
      </div>
    );
  }
}

export default App;
